Set-content -Path $Global:tmpFilePath -Value $decodedData -Encoding Byte
cls
$BinaryData=""
$decodedData = [System.Convert]::FromBase64String($BinaryData)
$Global:tmpFilePath2 = "$env:TEMP\Redshift_2.png"
Set-content -Path $Global:tmpFilePath2 -Value $decodedData -Encoding Byte
