Function Main {
    $textBox1.Text = "Running version $Version of Copy-RedshiftClusterBetweenRegions.ps1"
    $comboBox1.Enabled = $False
    $button1.Visible = $False
    $Global:Region = $comboBox1.Text
    $textBox1.AppendText($Global:Newline)
    $label2.Visible = $true
    $comboBox2.Enabled = $true
    $button2.Visible = $true
    PopulateClusterComboBox
}

Function PopulateRegionComboBox {
    $Regions = $null
    $Regions = Get-EC2Region
    $Regions = $Regions.RegionName
    
    $comboBox1.Items.Clear()
  
    #Populate List of AWS Regions
    foreach ($Region in $Regions)
        {$comboBox1.Items.Add($Region)|Out-Null}

    #Set the default AWS Region
    $comboBox1.Text = "ap-southeast-2"
}

Function PopulateClusterComboBox {
    $RSClusters = Get-RSClusters -Region $Global:Region
    $RSClusters = $RSClusters.ClusterIdentifier
    
    $comboBox2.Items.Clear()
  
    #Populate List of Redshift Clusters
    foreach ($RSCluster in $RSClusters)
        {$comboBox2.Items.Add($RSCluster)|Out-Null}
    $button2.Visible = $True
}

Function Main2 {
        $Global:ClusterIdentifier = $comboBox2.Text
        if ($Global:ClusterIdentifier -eq "")
            {
            Main
            }
        else
            {
            $label3.Visible = $true
            $textbox2.Enabled = $true
            $button3.Visible = $true
            $comboBox2.Enabled = $False
            $button2.Visible = $False
            }
}

Function Main3 {
        $Pattern = "[a-z]"
        $Pattern2 = ".--."
        $Global:SnapshotIdentifier = $textbox2.Text
        $Length = $Global:SnapshotIdentifier.Length
        $Length = $Length - 1
        $RSClusterSnapshots = Get-RSClusterSnapshots -Region $Global:Region
        if ($Global:SnapshotIdentifier -eq "")
            {
            Main2
            }
        elseif ($Global:SnapshotIdentifier -like "* *")
            {
            $textbox2.Text = ""
            $textbox1.AppendText("A Snapshot Identifier cannot have a space")
            $textbox1.AppendText($Global:Newline)
            Main2
            }
        elseif ($RSClusterSnapshots.SnapshotIdentifier -like "*$Global:SnapshotIdentifier*")
            {
            $existing = $textbox2.Text
            $textbox1.AppendText("The Snapshot Identifier $existing already exists")
            $textbox2.Text = ""
            $textbox1.AppendText($Global:Newline)
            Main2
            }
        elseif ($Global:SnapshotIdentifier[0] -notmatch $Pattern)
            {
            $existing = $textbox2.Text
            $textbox1.AppendText("The Snapshot Identifier $existing must start with a letter")
            $textbox2.Text = ""
            $textbox1.AppendText($Global:Newline)
            Main2
            }
        elseif ($Global:SnapshotIdentifier -match $Pattern2)
            {
            $existing = $textbox2.Text
            $textbox1.AppendText("The Snapshot Identifier $existing must not contain two consecutive hyphens")
            $textbox2.Text = ""
            $textbox1.AppendText($Global:Newline)
            Main2
            }
        elseif ($Global:SnapshotIdentifier[$Length] -eq "-")
            {
            $existing = $textbox2.Text
            $textbox1.AppendText("The Snapshot Identifier $existing must not end with a hyphen")
            $textbox2.Text = ""
            $textbox1.AppendText($Global:Newline)
            Main2
            }
        else
            {
            $label4.Visible = $true
            $combobox3.Enabled = $true
            $button4.Visible = $true
            $textbox2.Enabled = $False
            $button3.Visible = $False
            PopulateRegionComboBox3
            }
}

Function PopulateRegionComboBox3 {
    $Regions = $null
    $Regions = Get-EC2Region
    $Regions = $Regions.RegionName
    
    $comboBox3.Items.Clear()
  
    #Populate List of AWS Regions
    foreach ($Region in $Regions)
        {$comboBox3.Items.Add($Region)|Out-Null}

    #Set the default AWS Region
    $comboBox3.Text = "us-west-2"
}

Function Main4 {
    $Global:DestinationRegion = $comboBox3.Text
    if ($Global:DestinationRegion -eq $Global:Region)
            {
            Main3
            }
        else
            {
            $comboBox3.Enabled = $False
            $button4.Visible = $False
            PopulateGrantsComboBox3
            }
}

Function PopulateGrantsComboBox3 {
    $label5.Visible = $true
    $comboBox4.Enabled = $true
    $button5.Visible = $true

    $comboBox4.Items.Clear()

    $KMSKeys = Get-KMSKeys -Region $Global:DestinationRegion
    foreach ($KMSKey in $KMSKeys)
        {
        $KMSKeyDetail = Get-KMSKey -KeyId $KMSKey.KeyId -Region $Global:DestinationRegion
        if ($KMSKeyDetail.Description -like "*Redshift*")
            {
            $RedshiftKMSKey = $KMSKeyDetail
            }
        }
    $Date = Get-Date
    $Date = $Date.DateTime.ToString()
    $SnapshotCopyGrantName = $env:USERNAME + $Date -replace '[\W]', ''
    $Global:NewRSSnapshotCopyGrant = New-RSSnapshotCopyGrant -KmsKeyId $RedshiftKMSKey.KeyId -Region $Global:DestinationRegion -SnapshotCopyGrantName $SnapshotCopyGrantName

    $comboBox4.Items.Add($SnapshotCopyGrantName)|Out-Null
}

Function Main5 {
    $Global:SnapshotCopyGrantName = $comboBox4.Text
    if ($Global:SnapshotCopyGrantName -eq "")
            {
            Main4
            }
    else
        {
        $Global:SnapshotCopyGrantName = $Global:SnapshotCopyGrantName.ToLower()
        $DisableRSSnapshotCopy = Disable-RSSnapshotCopy -ClusterIdentifier $Global:ClusterIdentifier -Region $Global:Region
        $EnableRSSnapshotCopy = Enable-RSSnapshotCopy -DestinationRegion $Global:DestinationRegion -ClusterIdentifier $Global:ClusterIdentifier -SnapshotCopyGrantName $Global:SnapshotCopyGrantName -Region $Global:Region
        $comboBox4.Enabled = $False
        $button5.Visible = $False
        $textbox1.AppendText("Creating manual snapshot $Global:SnapshotIdentifier of $Global:ClusterIdentifier in $Global:Region")
        $textbox1.AppendText($Global:Newline)
        $RSClusterSnapshot = New-RSClusterSnapshot -SnapshotIdentifier $Global:SnapshotIdentifier -ClusterIdentifier $Global:ClusterIdentifier -Region $Global:Region
        $Sleep = 1
        $First = "Yes"
        Do
            {
            $Global:RSClusterSnapshot = Get-RSClusterSnapshots -SnapshotIdentifier $Global:SnapshotIdentifier
            if ($Global:RSClusterSnapshot.Status -eq "creating")
                {
                $Status = $Global:RSClusterSnapshot.Status
                if ($First -eq "Yes")
                    {
                    $textbox1.AppendText("Snapshot $Status")
                    $First = "No"
                    }
                else
                    {
                    $textbox1.AppendText(".")
                    }
                Sleep $Sleep
                $Sleep = $Sleep + 1
                $strQuit ="."
                }
            else
                {
                $Status = $Global:RSClusterSnapshot.Status
                $textbox1.AppendText("Snapshot $Status")
                $textbox1.AppendText($Global:Newline)
                $strQuit ="n"
                }
            }
        Until ($strQuit -eq "N")
        $Global:CopySnapshotClusterIdentifier = "copy:" + $Global:SnapshotIdentifier
        $Sleep = 1
        $FirstReg = "Yes"
        $FirstCopy = "Yes"
        Do
            {
            $Global:RSClusterSnapshot = Get-RSClusterSnapshots -Region $Global:DestinationRegion | Where-Object {($_.ClusterIdentifier -eq $Global:ClusterIdentifier) -and ($_.SourceRegion -eq $Global:Region) -and ($_.SnapshotIdentifier -eq $Global:CopySnapshotClusterIdentifier)}
            if ($Global:RSClusterSnapshot.Status -eq "available")
                {
                $Status = $Global:RSClusterSnapshot.Status
                $textbox1.AppendText("Snapshot $Global:CopySnapshotClusterIdentifier is $Status in $Global:DestinationRegion")
                $textbox1.AppendText($Global:Newline)
                $strQuit ="n"
                }
            elseif ($Global:RSClusterSnapshot -eq $null)
                {
                if ($FirstReg -eq "Yes")
                    {
                    $textbox1.AppendText("Snapshot $Global:CopySnapshotClusterIdentifier not yet registered in $Global:DestinationRegion")
                    $FirstReg = "No"
                    }
                else
                    {
                    $textbox1.AppendText(".")
                    }
                Sleep $Sleep
                $Sleep = $Sleep + 1
                $strQuit ="."
                }
            else
                {
                $Status = $Global:RSClusterSnapshot.Status
                if ($FirstCopy -eq "Yes")
                    {
                    $textbox1.AppendText("Snapshot $Global:CopySnapshotClusterIdentifier $Status")
                    $FirstCopy = "No"
                    }
                else
                    {
                    $textbox1.AppendText(".")
                    }
                Sleep $Sleep
                $Sleep = $Sleep + 1
                $strQuit ="."
                }
            }
        Until ($strQuit -eq "N")
        PopulateSecurityGroupComboBox
        }
}

Function PopulateSecurityGroupComboBox {
    $Sleep = 1
    $label6.Visible = $true
    $comboBox5.Enabled = $true
    $button6.Visible = $true
    $Global:EC2SecurityGroups = $null
    $Global:EC2SecurityGroups = Get-EC2SecurityGroup -Region $Global:DestinationRegion
    $SecurityGroupNames = ($Global:EC2SecurityGroups.Tags | Where-Object {$_.Key -eq "Name"}).Value
    $comboBox5.Items.Clear()
  
    #Populate List of Security Groups
    foreach ($SecurityGroupName in $SecurityGroupNames)
        {$comboBox5.Items.Add($SecurityGroupName)|Out-Null}
    $Global:EC2SecurityGroup = $null
    $textbox1.AppendText("Please select a VPC Security Group")
    $textbox1.AppendText($Global:Newline)
}

Function Main6 {
    $Global:EC2SecurityGroup = $comboBox5.Text
    $Names = ($Global:EC2SecurityGroups.Tags | ? {$_.Key -eq "Name"}).Value
    if ($Global:EC2SecurityGroup -eq "")
        {
        $Global:EC2SecurityGroup = $null
        $textbox1.AppendText("Please select a VPC Security Group")
        $textbox1.AppendText($Global:Newline)
        $SGSelected = "No"
        }
    elseif ($Names -notcontains $Global:EC2SecurityGroup)
        {
        $Global:EC2SecurityGroup = $null
        $textbox1.AppendText("Please select a VPC Security Group from the combo box")
        $textbox1.AppendText($Global:Newline)
        $SGSelected = "No"
        }
    else
        {
        $SGSelected = "Yes"
        }
    if ($SGSelected -eq "No")
        {
        }
    else
        {
        $Global:EC2SecurityGroup = $Global:EC2SecurityGroups | Where-Object {($_.Tags.Key -eq "Name") -and ($_.Tags.Value -eq $Global:EC2SecurityGroup)}
        $Description = $Global:EC2SecurityGroup.Description
        $GroupId = $Global:EC2SecurityGroup.GroupId
        $textbox1.AppendText("Selected $Description with Group ID $GroupId")
        $textbox1.AppendText($Global:Newline)
        $textbox1.AppendText("Your Source Cluster Identifier was $Global:ClusterIdentifier - what do you want your new Cluster Identifier to be in $Global:DestinationRegion ?")
        $textbox1.AppendText($Global:Newline)
        $comboBox5.Enabled = $false
        $button6.Visible = $false
        $label7.Visible = $true
        $textBox3.Enabled = $true
        $button7.Visible = $true
        }
}

Function Main7 {
    $Global:NewClusterIdentifier = $textBox3.Text
    $DestinationClusters = Get-RSClusters -Region $Global:DestinationRegion
    $DestinationClusters = $DestinationClusters.ClusterIdentifier
    if ($Global:NewClusterIdentifier -eq "")
        {
        }
    elseif ($Global:NewClusterIdentifier -like "* *")
        {
        $textbox3.Text = ""
        $textbox1.AppendText("A Cluster Identifier cannot have a space")
        $textbox1.AppendText($Global:Newline)
        }
    elseif ($DestinationClusters-like "*$Global:NewClusterIdentifier*")
        {
        $textbox3.Text = ""
        $textbox1.AppendText("Cluster Identifier already exists")
        $textbox1.AppendText($Global:Newline)
        }
    else
        {
        $button7.Visible = $false
        $textBox3.Enabled = $false
        $Sleep = 1
        $textbox1.AppendText("Restoring Cluster from Snapshot")
        $textbox1.AppendText($Global:Newline)
        $RSCluster = Get-RSClusters -ClusterIdentifier $Global:ClusterIdentifier -Region $Global:Region
        $RestoredRSFromClusterSnapshot = Restore-RSFromClusterSnapshot -Region $Global:DestinationRegion -SnapshotClusterIdentifier $Global:ClusterIdentifier -SnapshotIdentifier $Global:CopySnapshotClusterIdentifier -ClusterIdentifier $Global:NewClusterIdentifier -ClusterParameterGroupName $Global:RSCluster.ClusterParameterGroups.ParameterGroupName -VpcSecurityGroupId $Global:EC2SecurityGroup.GroupId -ClusterSubnetGroupName redshiftinternal -PubliclyAccessible $false
        $textbox1.AppendText("Note the cluster will not be publicly accessible and the Cluster Subnet group name is redshiftinternal")
        $textbox1.AppendText($Global:Newline)
        $First = "Yes"
        Do
            {
            $NewRSCluster = Get-RSClusters -ClusterIdentifier $Global:NewClusterIdentifier -Region $Global:DestinationRegion
            if ($NewRSCluster.ClusterStatus -eq "creating")
                {
                $ClusterID = $NewRSCluster.ClusterIdentifier
                $ClusterStatus = $NewRSCluster.ClusterStatus
                if ($First -eq "Yes")
                    {
                    $textbox1.AppendText("Redshift cluster $ClusterID is $ClusterStatus")
                    $First = "No"
                    }
                else
                    {
                    $textbox1.AppendText(".")
                    }
                Sleep $Sleep
                $Sleep = $Sleep + 1
                $strQuit ="."
                }
            else
                {
                $ClusterID = $NewRSCluster.ClusterIdentifier
                $ClusterStatus = $NewRSCluster.ClusterStatus
                $textbox1.AppendText("$ClusterID is $ClusterStatus")
                $textbox1.AppendText($Global:Newline)
                $Address = $NewRSCluster.Endpoint.Address
                $Port = $NewRSCluster.Endpoint.Port
                $textbox1.AppendText("The endpoint is $Address accessible on Port $Port")
                $textbox1.AppendText($Global:Newline)
                $strQuit ="n"
                }
            }
        Until ($strQuit -eq "N")
        }
    $DisableRSSnapshotCopy = Disable-RSSnapshotCopy -ClusterIdentifier $Global:ClusterIdentifier -Region $Global:Region
    MailMe
}

function MailMe() {
$Date = Get-Date
$Date = $Date.DateTime.ToString()
$Date = $Date -replace '[\W]', ''
Push-Location $env:temp
$FileName = ($Date) + "RedshiftClusterMigration.txt"
Remove-Item $FileName -ErrorAction SilentlyContinue
New-Item "$env:temp\$FileName" -ItemType File | Out-Null
$textFileName = "$env:temp\$FileName"
$textbox1.Text | out-file $textFileName -encoding ascii
sleep 2
$RecipientEmail = $env:USERNAME + $Global:CompanySuffix
$to="$RecipientEmail"
$subject="Your Redshift Cluster $Global:ClusterIdentifier Was Migrated to $Global:DestinationRegion"
$body= (Get-Content $textFileName | Out-String )
Send-MailMessage -Attachments $textFileName -SmtpServer $Global:smtpserver -From $Global:from -To $to -Subject $subject -Body $body
sleep 2
$textbox1.AppendText("Mail Sent - Goodbye")
$textbox1.AppendText($Global:Newline)
$form1.Close()
$form1.Dispose()
}

